import './App.css';
import FilteredList from './FilteredList.js'

function App() {
  const productList = [
    { name: "Cute Plant", size: "Medium", type: "Meat", price: "4.99"},
    { name: "Cute Plant", size: "Medium", type: "Meat", price: "4.99"},
    { name: "Cute Plant", size: "Medium", type: "Meat", price: "4.99"},
