    { name: "Cute Plant", size: "Medium", type: "Meat", price: "4.99"},
    { name: "Cute Plant", size: "Medium", type: "Meat", price: "4.99"},
    { name: "Cute Plant", size: "Medium", type: "Meat", price: "4.99"},
    { name: "Cute Plant", size: "Medium", type: "Meat", price: "4.99"},
    { name: "Cute Plant", size: "Medium", type: "Meat", price: "4.99"},
    { name: "Cute Plant", size: "Medium", type: "Meat", price: "4.99"},
    { name: "Cute Plant", size: "Large", type: "Meat", price: "4.99"}
   ]   
  return (
    <div>
      <FilteredList list={productList} />
    </div>
  );
}

export default App;
